(58, 'despre_noi', 'despre_noi', NULL, 'Despre noi', 'Despre noi', 'Who we are', 'Despre noi', 'Despre Noi', 'About Us', NULL, '<p>Companie ce are in randurile sale persoane cu experienta in materie de \r\npeste 10 ani, cu colaborari cu cele mai cunoscute si reprezentative \r\nfirme din domeniu.<br>\r\n<br>\r\n-- BARE DE RECTIFICAT DIN OTEL RAPID PATRATE DE LA 6X6 LA 40X40,DREPTUNGHIULARE DE LA 20X12 LA 40X25;<br>\r\n-- CUTITE DE STRUNG CU PLACUTE BRAZATE(STAS \r\n6376,6377,6378,6379,6380,6381,6382,6383,6384,6385,DIN 263,DIN 282,DIN \r\n283,8835,ROMASCON)<br>\r\n-- CUTITE DE STRUNG DIN OTEL RAPID MONOBLOC SI SUDATE(DIN 4951,STAS 353,STAS 6311 ,STAS 6312,STAS 354)<br>\r\n-- CUTITE DE MORTEZARE SI RABOTARE;<br>\r\n-- CUTITE GHILOTINA;><br>\r\n-- UNIVERSALE DE STRUNG;<br>\r\n-- VARFURI DE CENTRARE.<br>\r\n-- DIAMANTE INDUSTRIALE (1K; 1,5K; 2K; 2,5K; 3K; 3,5K; 4K)<br>\r\n-- PIETRE POLIZOR OTEL RAPID<br>\r\n-- PIETRE POLIZOR VIDIA<br>\r\n-- BURGHIE,TAROZI,FILIERE,FREZE,ALEZOARE ;<br>\r\n-- SUPORTI SI PLACUTE AMOVIBILE (SANDVIK; ISCAR; KENNAMETAL; WIDIA; WALTER; KORLOY; SECO)<br>\r\n-- FREZE DIN CARBURA MONOBLOC<br>\r\n-- LANT GALL , LANT PIV<br>\r\n-- FRANE ELECTROMAGNETICE FEA (FEA 1,6 ; FEA 2,5 ; FEA 5 ; FEA 10 ; FEA 20 )<br>\r\n-- RIDICATORI ELECTROHIDRAULICI REH (REH 12/50 ; REH 20/50 ; REH 50/50 ; REH 80/60 ; REH 125/60)<br>\r\n-- FRANE CIRCULARE CU SABOTI TIP FC (FC 200, FC 250, FC 315, FC 400, FC 500, FC 630, FC 710)<br>\r\n-- LIMITATOARE DE CURSA ELECTROCONTACT (4463; 4464; 4471; 4472; 4473; 4474; 4475; 4481; 4482; 4485; 4486)<br>\r\n-- POMPE HIDRAULICE CU PISTOANE AXIALE (F110 A ; F112 A ; F116 A ; F120 A ; F125 A ; F132 A ; F140 A)<br>\r\n-- CUPLAJE ELECTROMAGNETICE<br>\r\n-- INTRERUPATOARE AUTOMATE OROMAX (1000A ; 1600A ; 2000A ; 2500A)<br>\r\n-- CONTACTORI ELECTRICI (ELECTROPARATAJ; MOELLER; SCHNEIDER; SIEMENS; TELEMECANIQUE; ABB)<br>\r\n-- CUTII COMANDA PENTRU POD RULANT/MACARA (2; 4; 6; 8; 10 BUTONAE)<br>\r\n-- MOTOARE ELECTRICE TRIFAZATE<br>\r\n-- MOTOARE ELECTRICE MONOFAZATE<br>\r\n-- MOTOARE ELECTRICE ANTIEXPLOZIVE<br>\r\n-- MOTOARE ELECTRICE CU FRANA<br>\r\n-- CONVERTIZOARE DE FRECVENTA<br>\r\n-- REDUCTOARE (MELCATE; COAXIALE; ORTOGONALE; PLANETARE)<br>\r\n-- ORGANE DE ASAMBLARE (SURUBURI; PIULITE; SAIBE;<br>\r\n-- SNURURI DE ETANSARE<br>\r\n-- BARE SI PLACI (TEFLON; POLIAMIDA; TEXTOLIT; BRONZ; CUPRU; ALAMA; INOX; ALUMINIU; PLUMB; OTEL)<br>\r\n-- CORPURI DE ILUMINAT (PROIECTOARE, LAMPI; BECURI; TUBURI; PLAFONIERE)<br>\r\n-- CABLURI ELECTRICE SI OTEL<br>\r\n-- TRANSFORMATOARE ELECTRICE ( 16 KVA; 25 KVA; 40 KVA; 63 KVA; 100 KVA; \r\n160 KVA; 250 KVA; 400 KVA; 630 KVA; 800 KVA; 1000 KVA; 1250 KVA; 1600 \r\nKVA)<br>\r\n<br>\r\nPentru noi respectul fata de clienti si calitatea inalta a serviciilor furnizate este politica de baza a companiei.\r\n    	<br></p>', '<p>is a privately owned, independent company with over 10 years of \r\nexperience on the field of machine tools. We offer different spare parts\r\n and accessories for machine tools of European origin (Polish, Czech, \r\nBulgarian, Romanian, German and Russian).<br></p><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36838\" style=\"margin:0px;padding:0px;\"><br id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36839\" clear=\"none\"></div><p><br></p><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36840\" style=\"margin:0px;padding:0px;\">Electromagnetic Clutches and Brakes <br></div><p><br></p><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36843\" style=\"margin:0px;padding:0px;\">STROMAG : </div><p><br></p><p><br></p><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36846\" style=\"margin:0px;padding:0px;\">EKE 5 , EKE 10 , EKE 16 , EKE 25 , EKE 40 , EKE 63</div><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36847\" style=\"margin:0px;padding:0px;\">ERD 5 , ERD 10 , ERD 16 , ERD 25 , ERD 40 , ERD 63</div><div id=\"yiv8239430119yui_3_16_0_ym19_1_1483693244187_36848\" style=\"margin:0px;padding:0px;\">EMD 5 , EMD 10 , EMD 16 , E