(77, 'politica-de-confidentialitate', 'politica-de-confidentialitate', NULL, 'Politica de confidentialitate', 'Politica de confidentialitate', NULL, 'Politica de confidentialitate', NULL, NULL, NULL, 'Lorem Ipsum este pur şi simplu o machetă pentru text a \r\nindustriei tipografice. Lorem Ipsum a fost macheta standard a industriei\r\n încă din secolul al XVI-lea, când un tipograf anonim a luat o planşetă \r\nde litere şi le-a amestecat pentru a crea o carte demonstrativă pentru \r\nliterele respective. Nu doar că a supravieţuit timp de cinci secole, dar\r\n şi a facut saltul în tipografia electronică practic neschimbată. A fost\r\n popularizată în anii \'60 odată cu ieşirea colilor Letraset care \r\nconţineau pasaje Lorem Ipsum, iar mai recent, prin programele de \r\npublicare pentru calculator, ca Aldus PageMaker care includeau versiuni \r\nde Lorem Ipsum.', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(83, 'servicii', 'servicii', NULL, 'Servicii', 'Servicii', 'Services', 'Servicii', 'Servicii', 'Services', NULL, '<p>PIESE-INDUSTRIALE.RO vă oferă următoarele servicii:<br><br><br>-Reparatii Cuplaje electromagnetice <br>-Reparaţii Frâne electromagnetice şi Frâne circulare<br>-Reparatii Ambreiaje mecanice, hidraulice, electromagnetice<br>-Reparaţii Ridicători electrohidraulici<br>-Reparatii si rebobinari pentru Motoare electrice<br>-Reparatii Convertizoare de frecventa<br>-Reparatii Transformatoare electrice<br>-Reconditionari si Reparatii Rulmenti<br>-Reparatii Contactori electrici si Intrerupatoare automate<br>-Reparatii Reductoare <br>-Reparaţii de alte echipamente mecanice, electrice şi hidraulice pentru instalaţii de ridicat<br>-Reparatii Pompe hidraulice de orice proveniență<br>-Executăm Roţi dinţate, axe, flanse, piese paralelipipedice, etc.<br>-Executăm Discuri cu fricțiune și oțel conform desen tehnic sau model</p>', '<p>PIESE-INDUSTRIALE.RO offers you the following services:<br><br><br><br>-Repairs Electromagnetic Clutches <br>-Repairs Electromagnetic Brakes and Thruster Drum Brakes<br>-Repairs Clutches mechanical, hydraulic, electromagnetic<br>-Repairs Thruster Electro Hydraulic ELDRO and ELHY <br>-Repairs and Rewing Electric Motors<br>-Repairs Frequency Inverter <br>-Repairs Electric Transformers<br>-Repairs Bearings<br>-Repairs Electric Contactors and Circuit Breakers<br>-Repairs Gearboxes <br>-Repairs Hydraulic Pumps<br>-Execute friction and steel discs according to the technical drawing or model<br></p>', NULL, NULL, NULL, NULL, NULL, NULL);
