(8, 2, 1, 'Sunt de Acord cu Termeni & Conditii', NULL, 0, 'Termeni & Conditii', NULL, NULL, NULL, NULL, '<p>Lorem Ipsum este pur şi simplu o machetă pentru text a industriei tipografice. Lorem Ipsum a fost macheta standard a industriei încă din secolul al XVI-lea, când un tipograf anonim a luat o planşetă de litere şi le-a amestecat pentru a crea o carte demonstrativă pentru literele respective. Nu doar că a supravieţuit timp de cinci secole, dar şi a facut saltul în tipografia electronică practic neschimbată. A fost popularizată în anii \'60 odată cu ieşirea colilor Letraset care conţineau pasaje Lorem Ipsum, iar mai recent, prin programele de publicare pentru calculator, ca Aldus PageMaker care includeau versiuni de Lorem Ipsum.</p><p><br></p><p>Vezi si <a href=\"http://workmyweb.ro/p/protectia-datelor-cu-caracter-personal\"><strong>Protectia datelor cu caracter personal</strong></a><br></p>', NULL, NULL),
